mapper.select:

select 

from RMINSNO
where RMINSNO_SENDER_BANK = #{rminsnoSenderBank,jdbcType=CHAR}
  and RMINSNO_RECEIVER_BANK = #{rminsnoReceiverBank,jdbcType=CHAR}

mapper.delete:

